import React, { useEffect, useState } from "react";
import fakeData from "../../fakeData/MOCK_DATA.json";
import DisplayData from "../DisplayData/DisplayData";
import "./InputData.css";
import AddedTeamPlayer from "../AddedTeamPlayer/AddedTeamPlayer";
const InputData = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    setUsers(fakeData);
  }, []);

  const handlePlyer = (newPlyer) => {
    console.log("added", newPlyer);
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-8">
          <div className="container">
            <div className="row">
              <div className="col-md-3">
                {users.map((user) => (
                  <DisplayData
                    handlePlyer={handlePlyer}
                    users={user}
                  ></DisplayData>
                ))}
              </div>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div>
            {/* <h1>payer {users.length}</h1> */}
            <AddedTeamPlayer></AddedTeamPlayer>
          </div>
        </div>
      </div>
    </div>
  );
};

export default InputData;
